import React from 'react';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';
import { NavigationContainer } from '@react-navigation/native';
import { Ionicons } from '@expo/vector-icons';
import { Home } from '../Screens'
import { Header, LoadAssets } from '../Components'

const fonts = {
  "Bold": require("../../assets/fonts/SF-Pro-Text-Bold.otf"),
  "Semibold": require("../../assets/fonts/SF-Pro-Text-Semibold.otf"),
  "Regular": require("../../assets/fonts/SF-Pro-Text-Regular.otf"),
};

const HomeStack = createStackNavigator();
  
function HomeStackScreen() {
  return (
    <HomeStack.Navigator headerMode={'float'} >
      <HomeStack.Screen name="Home" component={Home}
        options={({navigation}) => ({
          title: 'Blitz',
          headerTitleStyle: { fontSize: 30, fontFamily: 'Bold' },
          headerTitleAlign: 'center',
          headerStyle: { borderBottomLeftRadius: 25, borderBottomRightRadius: 25 },
          headerTitle: () => <Header navigation={navigation} />,
        })}
      />
    </HomeStack.Navigator>
  );
}

const Tab = createBottomTabNavigator();

function BottomTabNavigator() {
  return (
    <Tab.Navigator
      tabBarOptions={{
          activeTintColor: '#1687FF',
          inactiveTintColor: 'gray',
          style:{paddingBottom: 3, height:50}
      }}
    >
      <Tab.Screen name="Home" component={HomeStackScreen} options={{
        tabBarIcon: ({ color, size }) => (
          <Ionicons name={'ios-home'} color={color} size={size} />
        ),
      }}/>
      <Tab.Screen name="Explore" component={Home} options={{
        tabBarIcon: ({ color, size }) => (
          <Ionicons name={'ios-search'} color={color} size={size} />
        ),
      }}/>
      <Tab.Screen name="Archived" component={Home} options={{
        tabBarIcon: ({ color, size }) => (
          <Ionicons name={'md-bookmark'} color={color} size={size} />
        ),
      }}/>
      <Tab.Screen name="Profile " component={Home} options={{
        tabBarIcon: ({ color, size }) => (
          <Ionicons name={'ios-contact'} color={color} size={size} />
        ),
      }}/>
    </Tab.Navigator>
  )
}

export default function App() {
    return (
      <LoadAssets {...{ fonts }}>
        <BottomTabNavigator />
      </LoadAssets>
    );
  }
